import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  data: ["leasingInfo", "address", "unitType", "community", "unit"],
};

const unitSlice = createSlice({
  name: "unit",
  initialState,
  reducers: {},
});

export const selectUnits = (state) => state.unit.data;

export default unitSlice.reducer;
